import { Box, SxProps, Theme, Typography } from "@mui/material";

export const Main = () => {
    return (
        <Box className="Main" sx={sx}>
            <Box className="LoginBox">
                <Typography className="LoginText" variant="h3">Login</Typography>
                <Textarea></Textarea>
            </Box>
        </Box>
    );
};

// クラス名に対するスタイルを定義
const sx: SxProps<Theme> = {
    "&.Main": {
        width: "100%",
    },
    ".LoginBox": {
        placeContent: "center"
    },
    ".LoginText": {
        color: "#222",
    },
};
